INSERT INTO `bol_language_da` VALUES (1,'menu','administration','Administration'),(2,'menu','classes','Klasser'),(3,'menu','display_text','Vis tekst'),(4,'menu','download_lexicon','Download ordliste'),(5,'menu','enroll_in_class','Tilmeld til klasse'),(6,'menu','exercises','velser'),(7,'menu','font_preferences','Skrifttyper'),(8,'menu','home','Hjem'),(9,'menu','login','Log ind'),(10,'menu','logout','Log ud'),(11,'menu','manage_exercises','velseshndtering'),(12,'menu','manage_gloss_links','Gloselinks'),(13,'menu','my_data','Mine data'),(14,'menu','privacy_policy','Privatlivspolitik'),(15,'menu','profile','Profil'),(16,'menu','statistics','Statistik'),(17,'menu','text_and_exercises','Tekst og velser'),(18,'menu','translate_grammar','Overst grammatiske termer'),(19,'menu','translate_interface','Overst interface'),(20,'menu','translate_lexicon','Overst ordbog'),(21,'menu','users','Brugere'),(22,'menu','user_access','Brugeradgang'),(23,'intro_text','intro_center','<h1>Hvad er Bible Online Learner?</h1>\n\n    <p>Bible Online Learner (Bible OL) giver fri adgang til den hebraiske bibel i ETCBC4-databasen\n    og Nestles 1904-tekst til det grske Ny Testamente med grammatiske annotationer. Endvidere kan\n    lrere benytte velser der er udviklet til Bible OL, eller de kan oprette egne velser.</p>\n\n    <p>Bible OL har links til <a href=\"http://shebanq.ancient-data.org\"\n    target=\"shebanq\">SHEBANQ</a>, som er et prmieret sge- og prsentationsvrktj til den\n    hebraiske bibel. Fra et kapitel i Bible OL kan du klikke p SHEBANQ\'s logo og hoppe direkte til\n    det pgldende kapitel p deres websted. Endvidere kan facilitatorer benytte sgninger fra SHEBANQ\n    til at generere velser i Bible OL.</p>\n\n    <p>Kildeteksten til Bible OL er tilgngelig p <a href=\"https://github.com/EzerIT/BibleOL\"\n    target=\"_blank\">GitHub</a>. Vi hber at udviklere vil fork\'e denne kode og hjlpe os med at\n    tilfje nye faciliteter.</p>'),(24,'intro_text','intro_right1','<p>Siden 2014 har Bible Online Learner vre en del af <a href=\"http://global-learning.org\"\n    target=\"_blank\">Global Learning Initiative</a>. Yderligere oplysnigner fs hos professor Nicolai\n    Winther-Nielsen (nwn [at] dbi . edu) hos <a href=\"http://fih.fjellhaug.no\"\n    target=\"_blank\">Fjellhaug International University College Denmark (FIUC-DK)</a>.<br>\n\n    Bible Online Learner blev udviklet af Claus Tndering fra <a href=\"http://www.ezer.dk\"\n    target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n    For sit PhD-studium ved Aalborg universitet udvikler Judith Gottschalk <i>Learning Journey,</i>\n    en plugin som giver statistiske oplysninger om\n    hvorledes studerende klarer sig i Bible OL.</p>'),(25,'intro_text','intro_right2','<p>Bible Online Learner er baseret p PLOTLearner, et PC-program der blev udklet som en del af <a\n    href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT-projektet</a> i 2010-2013. Nrvrende\n    websted er resultatet af videre udvikling foretaget af Ezer IT Consulting uden for\n    EuroPLOT-projektet. Webstedet vedligeholdes af <a href=\"http://3bmoodle.dk\" target=\"_blank\">3BM\n    Bible Software and Multimedia</a>.</p>'),(26,'intro_text','intro_right3','<p>SHEBANQ-webstedet blev skabt af Wido van Peursen og Dirk Roorda.</p>'),(27,'intro_text','intro_right_head','Bible Online Learner &ndash; fri global lring'),(28,'intro_text','welcome','Velkommen til Bible Online Learner'),(29,'intro_text','welcome2','%s, velkommen til Bible Online Learner'),(30,'translate','comment','Kommentar'),(31,'translate','download_lex','Download ordliste'),(32,'translate','download_lex_desc','<p>Klik p den ordliste du nsker. En CSV-fil med den valgte ordliste vil s blive downloadet.</p>'),(33,'translate','each_page_shows','Hver side viser %d emner.'),(34,'translate','first_occurence','Frste forekomst'),(35,'translate','illegal_source_language','Ulovligt kildesprog'),(36,'translate','illegal_target_language','Ulovligt mlsprog'),(37,'translate','items_text_database','Antal emner i denne tekstdatabase: %d.'),(38,'translate','items_text_group','Antal emner i denne tekstgruppe: %d.'),(39,'translate','lang_aram','Aramisk'),(40,'translate','lang_greek','Grsk'),(41,'translate','lang_heb','Hebraisk'),(42,'translate','lexeme','Leksem'),(43,'translate','malformed_url','Forkert URL'),(44,'translate','modified','Modificeret?'),(45,'translate','name_prefix','Navneprfiks'),(46,'translate','revert','Fortryd'),(47,'translate','revert_all','Fortryd alt'),(48,'translate','select_gloss_translate_range','<p>Vlg det sprog og de gloser hvis oversttelse du nsker at ndre.</p> <p>Du kan enten vlge de %d hyppigste gloser (de vil blive vist sorteret efter hyppighed), eller du kan vlge gloserne alfabetisk.</p>'),(49,'translate','select_words_translate','Vlg ord der skal oversttes'),(50,'translate','show_strings_without_translation','Vis %d emne(r) uden oversttelse'),(51,'translate','stem','Stamme'),(52,'translate','strongs','Strongs'),(53,'translate','submit_changes','Opdatr'),(54,'translate','symbolic_lexeme','Symbolsk leksem'),(55,'translate','symbolic_name','Symbolsk navn'),(56,'translate','target_language','Mlsprog:'),(57,'translate','text_database','Tekstdatabase'),(58,'translate','text_group','Tekstgruppe'),(59,'translate','translate_grammar_desc','<p>Vlg den relevante tekstdatabase (<i>ETCBC4</i> og <i>ETCBC4-translit</i> er hebraiske, <i>nestle1904</i> er grsk) og angiv en oversttelse af hver grammatisk term.</p>'),(60,'translate','translate_grammar_terms','Overst grammatiske termer'),(61,'translate','translate_interface_desc','<p>Angiv en oversttelse for hvert element i brugergrnsefladen.</p>'),(62,'translate','translate_lex','Overst gloser'),(63,'translate','translate_lex_desc','<p>Vlg mlsprog, ret de nskede oversttelser og klik p Opdatr i bunden af skrmen.</p>'),(64,'translate','translate_user_interface','Overst brugergrnseflade'),(65,'translate','untranslated_strings','Emner uden oversttelse'),(66,'common','already_logged_in','Du er 