al indeholde et tal mindre end {param}.'),(379,'form_validation','form_validation_less_than_equal_to','Feltet <i>{field}</i> skal indeholde et tal mindre end eller lig med {param}.'),(380,'form_validation','form_validation_matches','Feltet <i>{field}</i> svarer ikke til feltet <i>{param}</i>.'),(381,'form_validation','form_validation_max_length','Feltet <i>{field}</i> m ikke vre mere end {param} tegn langt.'),(382,'form_validation','form_validation_min_length','Feltet <i>{field}</i> skal vre mindst {param} tegn langt.'),(383,'form_validation','form_validation_numeric','Feltet <i>{field}</i> m kun indehold tal.'),(384,'form_validation','form_validation_regex_match','Feltet <i>{field}</i> har ikke korrekt format.'),(385,'form_validation','form_validation_required','Feltet <i>{field}</i> skal udfyldes.'),(386,'form_validation','form_validation_valid_email','Feltet <i>{field}</i> skal indeholde en gyldig email-adresse.'),(387,'form_validation','form_validation_valid_emails','Feltet <i>{field}</i> skal indeholde alle gyldige email-adresser.'),(388,'form_validation','form_validation_valid_ip','Feltet <i>{field}</i> skal indeholde en gyldig IP.'),(389,'form_validation','form_validation_valid_url','Feltet <i>{field}</i> skal indeholde en gyldig URL.'),(390,'privacy','privacy_policy_title','Privatlivspolitik'),(391,'privacy','privacy_text','<h1>Privatlivspolitik</h1>\n\n     <p>Denne privatlivspolitik fastlgger hvordan Bible Online Learner benytter og beskytter de oplysninger\n     som du angiver nr du bliver registreret p dette websted.</p>\n\n     <p>Du kan bruge visse funktioner p dette websted uden at registrere dig. I s fald indsamler vi ingen\n     personlige oplysninger om dig.</p>\n\n     <h2>Hvad indsamler vi?</h2>\n     <p>Hvis du fr en konto p dette websted, indsamle vi flgende oplysninger:</p>\n\n     <ul>\n       <li>Navn</li>\n       <li>Email-adresse</li>\n     </ul>\n\n     <p>Disse oplysninger benyttes udenlukkede for at</p>\n     <ul>\n       <li>identificere dig nr du benytter webstedet,</li>\n       <li>om ndvendigt sende dig emails om webstedets tilstand.</li>\n     </ul>\n\n     <p>Vi videregiver ikke dine oplysninger til tredjepart til brug for markedsfring eller reklame,\n     og vi slger ikke dine oplysninger.</p>\n\n     <h2>Hvordan sletter du din konto?</h2>\n\n     <p>Du kan slette din konto p dette websted ved at vlge menupunktet Profil under Mine data\n     og derp klikke p knappen Nedlg profilen. Dette vil fjerne alle oplysninger om dit navn og din\n     email-adresse fra dette websted.</p>\n\n     <h2>Links til andre websteder</h2>\n\n     <p>Vores websted kan indeholde links der gr det let for dig at besge andre interessante websteder.\n     Men s snart et sdant link har frt dig vk fra vores websted, skal du vre opmrksom p at vi ikke\n     har nogen kontrol over det andet websted. Vi er derfor ikke ansvarlige for hvad der sker hvis du\n     dr giver private oplysninger, og sdanne websteder er ikke underlagt nrvrende privatlivspolitik.\n     Du br vre forsigtig og undersge hvilke privatlivsregler der glder for disse andre websteder.</p>'),(392,'file_manager','access_denied_to','Der er ikke adgang til \'%s\''),(393,'file_manager','added_ownership','Ejerskab tilfjet for disse velser:'),(394,'file_manager','already_exists','\'%s\' findes allerede'),(395,'file_manager','cancel_copy','Afbryd kopiering'),(396,'file_manager','cancel_copy_title','Annullr kopiering'),(397,'file_manager','cancel_move','Afbryd flytning'),(398,'file_manager','cannot_change_visibility_top','Man kan ikke ndre synligheden af den verste mappe'),(399,'file_manager','cannot_copy','Kan ikke kopiere filen \'%s\''),(400,'file_manager','cannot_create_folder','Kan ikke skabe mappen \'%s\''),(401,'file_manager','cannot_delete_file','Kan ikke slette filen \'%s\''),(402,'file_manager','cannot_delete_folder','Kan ikke slette mappen \'%s\''),(403,'file_manager','cannot_open_folder','Kan ikke bne mappen \'%s\''),(404,'file_manager','cannot_rename','