INSERT INTO `bol_language_en` VALUES (1,'menu','administration','Administration'),(2,'menu','classes','Classes'),(3,'menu','display_text','Display text'),(4,'menu','download_lexicon','Download lexicon'),(5,'menu','enroll_in_class','Enroll in class'),(6,'menu','exercises','Exercises'),(7,'menu','font_preferences','Font preferences'),(8,'menu','home','Home'),(9,'menu','login','Login'),(10,'menu','logout','Logout'),(11,'menu','manage_exercises','Manage exercises'),(12,'menu','manage_gloss_links','Gloss links'),(13,'menu','my_data','My Data'),(14,'menu','privacy_policy','Privacy policy'),(15,'menu','profile','Profile'),(16,'menu','statistics','Statistics'),(17,'menu','text_and_exercises','Text and Exercises'),(18,'menu','translate_grammar','Translate grammar terms'),(19,'menu','translate_interface','Translate interface'),(20,'menu','translate_lexicon','Translate lexicon'),(21,'menu','users','Users'),(22,'menu','user_access','User Access'),(23,'intro_text','intro_center','<h1>What Is Bible Online Learner?</h1>\n\n      <p>Bible Online Learner (Bible OL) gives free access to the Hebrew Bible in the ETCBC4\n       database and Nestles 1904 text of the Greek New Testament with grammatical annotations;\n       furthermore, teachers can use exercises developed for Bible OL or create their own.</p>\n\n       <p>Bible OL is interlinked with the award-winning Hebrew query and text display site <a\n       href=\"http://shebanq.ancient-data.org\" target=\"shebanq\">SHEBANQ</a>. From a chapter in Bible\n       OL, click the SHEBANQ logo to jump directly to that chapter on their website. Furthermore,\n       facilitators can use queries from SHEBANQ to generate exercises in Bible OL.</p>\n\n       <p>The source code for Bible OL is available at <a href=\"https://github.com/EzerIT/BibleOL\"\n       target=\"_blank\">GitHub</a>. We hope developers will fork this code and join us to add\n       additional features.</p>'),(24,'intro_text','intro_right1','<p>Since 2014, Bible Online Learner has been part of the <a href=\"http://global-learning.org\"\n       target=\"_blank\">Global Learning Initiative</a>. For more information, please contact Professor\n       Nicolai Winther-Nielsen (nwn [at] dbi . edu) of <a\n       href=\"http://fih.fjellhaug.no\" target=\"_blank\">Fjellhaug International\n       University College Denmark (FIUC-DK)</a>.<br>\n\n       Bible Online Learner was developed by Claus Tndering of <a href=\"http://www.ezer.dk\"\n       target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n       For her PhD at Aalborg University, Judith Gottschalk is developing <i>Learning Journey,</i>\n       a plugin with statistics on learner performance.</p>'),(25,'intro_text','intro_right2','<p>Bible Online Learner is based on PLOTLearner, a PC program developed as part of the\n       <a href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT</a> project 2010-2013. The\n       present website is the result of further development by Ezer IT Consulting outside the\n       EuroPLOT project, and the site is maintained by <a href=\"http://3bmoodle.dk\"\n       target=\"_blank\">3BM Bible Software and Multimedia</a>.</p>'),(26,'intro_text','intro_right3','<p>The SHEBANQ web site was created by Wido van Peursen and Dirk Roorda.</p>'),(27,'intro_text','intro_right_head','Bible Online Learner for Free Global Learning'),(28,'intro_text','welcome','Welcome to Bible Online Learner'),(29,'intro_text','welcome2','%s, welcome to Bible Online Learner'),(30,'translate','comment','Comment'),(31,'translate','download_lex','Download Lexicon'),(32,'translate','download_lex_desc','<p>Click the lexicon you want. This will download a CSV file with the selected lexicon.</p>'),(33,'translate','each_page_shows','Each page shows %d items.'),(34,'translate','first_occurence','First occurence'),(35,'translate','illegal_source_language','Illegal source language'),(36,'translate','illegal_target_language','Illegal target language'),(37,'translate','items_text_database','Number of item