INSERT INTO `bol_language_es` VALUES (1,'menu','administration','Administracin'),(2,'menu','classes','Clases'),(3,'menu','display_text','Mostrar texto'),(4,'menu','enroll_in_class','Registrarse en clase'),(5,'menu','exercises','Ejercicios'),(6,'menu','font_preferences','Preferencias de fuente'),(7,'menu','home','Inicio'),(8,'menu','login','Iniciar sesin'),(9,'menu','logout','Cerrar sesin'),(10,'menu','manage_exercises','Administrar ejercicios'),(11,'menu','manage_gloss_links','Enlaces de glosa'),(12,'menu','my_data','Mi Informacin'),(13,'menu','privacy_policy','Pliza de privacidad'),(14,'menu','profile','Perfil'),(15,'menu','statistics','Estadsticas'),(16,'menu','text_and_exercises','Texto y Ejercicios'),(17,'menu','users','Usuarios'),(18,'menu','user_access','Acceso de usuario'),(19,'intro_text','intro_center','<h1>Qu Es Bible Online Learner?</h1>\n\n      <p>Bible Online Learner (Bible OL) ofrece libre acceso a la Biblia Hebraica en la base de datos \n       ETCBC4 y al texto Griego del Nuevo Testamento Nestles 1904 con anotaciones gramaticales;\n       adems, profesores pueden usar ejercicios desarrollados para Bible OL o crear sus propios.</p>\n\n       <p>Bible OL est interrelacionado con el premiado sitio web de Hebreo para bsquedas y muestra de texto <a\n       href=\"http://shebanq.ancient-data.org\" target=\"shebanq\">SHEBANQ</a>. Desde un captulo en Bible\n       OL, haga click al logo de SHEBANQ para ir directamente al mismo captulo en su sitio web. Adems,\n       facilitadores puede usar desde SHEBANQ para generar ejercicios en Bible OL.</p>\n\n       <p>La fuente de cdigo para Bible OL est disponible en <a href=\"https://github.com/EzerIT/BibleOL\"\n       target=\"_blank\">GitHub</a>. Esperamos que programadores puedan trabajar con este cdigo y se unan a nosotros para adicionar\n       caractersticas adicionales.</p>'),(20,'intro_text','intro_right1','<p>Desde el 2014, Bible Online Learner ha sido parte de <a href=\"http://global-learning.org\"\n       target=\"_blank\">Global Learning Initiative</a>. Para ms informacin, por favor contacte Profesor\n       Nicolai Winther-Nielsen (nwn [at] dbi . edu) de <a\n       href=\"http://fih.fjellhaug.no\" target=\"_blank\">Fjellhaug International\n       University College Denmark (FIUC-DK)</a>.<br>\n\n       Bible Online Learner fue desarrollado por Claus Tndering of <a href=\"http://www.ezer.dk\"\n       target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n       Para su Doctorado en Aalborg University, Judith Gottschalk est desarrollando <i>Learning Journey,</i>\n       una adicin con estadsticas en el rendimiento del estudiante.</p>'),(21,'intro_text','intro_right2','<p>Bible Online Learner est basado en PLOTLearner, un programa de desarrollado como parte del proyecto\n       <a href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT</a> 2010-2013. El\n       presente sitio web es el resultado de major desarrollo por Ezer IT Consulting fuera del proyecto\n       EuroPLOT, y el sitio web es mantenido por <a href=\"http://3bmoodle.dk\"\n       target=\"_blank\">3BM Bible Software and Multimedia</a>.</p>'),(22,'intro_text','intro_right3','<p>El sitio web SHEBANQ fue creado por Wido van Peursen and Dirk Roorda.</p>'),(23,'intro_text','intro_right_head','Bible Online Learner para un Aprendizaje Global Gratuito'),(24,'intro_text','welcome','Bienvenido Bible Online Learner'),(25,'intro_text','welcome2','%s, bienvenido a Bible Online Learner'),(26,'common','already_logged_in','Usted ya ha iniciado sesin'),(27,'common','cancel_button','Cancelar'),(28,'common','cannot_open_file','No se puede abrir el archivo: %s'),(29,'common','close_button','Cerrar'),(30,'common','date_time_format','dMA H:i'),(31,'common','error_colon','Error:'),(32,'common','facebook_no_valid_reply','Respuesta no vlida de Facebook'),(33,'common','field_required','(Requerido)'),(34,'common','google_no_valid_reply','Respuesta no vlida de Google'),(35,'common','illegal_class_id','Identificacin de clase ilegal'),(36,