ld}</i> debe contener una URL vlida.'),(344,'privacy','privacy_policy_title','Pliza de Privacidad'),(345,'privacy','privacy_text','<h1>Pliza de Privacidad</h1>\n\n     <p>Esta pliza de privacidad establece como Bible Online Learner usa and proteje cualquier informacin que t\n     provees cuando te registras en este sitio web.</p>\n\n     <p>Usted puede usar algunas funciones en este sitio web sin tener que registrarse. En ese caso, no colectamos\n     informacin personal acerca de t.</p>\n\n\n     <h2>Que colectamos</h2>\n     <p>Si estableces una cuenta en este sitio web, puede que colectemos la siguiente informacin:</p>\n\n     <ul>\n       <li>Nombre</li>\n       <li>Correo Electrnico</li>\n     </ul>\n\n     <p>Esta informacin es usada solamente para el prposito de</p>\n     <ul>\n       <li>identificarte cuando usas el sitio web,</li>\n       <li>si es necesario, enviarte correo electrnicos acerca del estado de este sitio web.</li>\n     </ul>\n\n     <p>No proporcionaremos tu informacin a terceras personas para venta o prpositos promocionales, ni\n     venderemos tu informacin.</p>\n\n     <h2>Eliminar tu cuenta</h2>\n\n     <p>Usted puede eliminar su cuenta en este sitio web seleccionando el men Perfil del \n     men Mi informacin y luego haga click al botn etiquetado Eliminar el perfil. Esto remover toda\n     informacin acerca de tu nombre y correo electrnico en este sitio web.</p>\n\n     <h2>Enlaces a otros sitios web.</h2>\n\n     <p>Nuestro sitio web contiene enlaces te ayudan a visitar otros sitios web de fcil inters. Sin embargo,\n     una vez que hayas usado estos enlaces para abandonar nuestro sitio, usted debe notar que no tenemos control\n     sobre ese otro sitio web. Por lo tanto, no podemos ser responsable por la proteccin y privacidad de la\n     informacin que provees mientras visitas tales sitios and esos sitios no estan governados por esta \n     declaracin de privacidad. Usted debe de ejercitar cuidado y leer la declaracin de privacidad aplicable al\n     sitio web en pregunta.</p>'),(346,'file_manager','access_denied_to','Acceso negado para \'%s\''),(347,'file_manager','added_ownership','Propiedad adicionada para estos ejercicios:'),(348,'file_manager','already_exists','\'%s\' ya existe'),(349,'file_manager','cancel_copy','Cancelar operacin de copiar'),(350,'file_manager','cancel_copy_title','Cancelar copia'),(351,'file_manager','cancel_move','Cancelar operacin de mover'),(352,'file_manager','cannot_change_visibility_top','No puedes cambiar la visibilidad de la carpeta superior'),(353,'file_manager','cannot_copy','No se puede copiar el archivo \'%s\''),(354,'file_manager','cannot_create_folder','No se puede crear la carpeta \'%s\''),(355,'file_manager','cannot_delete_file','No se puede borrar el archivo \'%s\''),(356,'file_manager','cannot_delete_folder','No se puede borrar la carpeta \'%s\''),(357,'file_manager','cannot_open_folder','No se puede abrir la carpeta \'%s\''),(358,'file_manager','cannot_rename','No puede ser renombrado \'%s\' a \'%s\''),(359,'file_manager','change_owner_files','Cambiar propietario de los archivos marcados'),(360,'file_manager','class','Clase'),(361,'file_manager','click_and_go_to','Click OK aqu, y luego vaya a la carpeta de destino y presione %s.'),(362,'file_manager','confirm_deletion','Confirmar Eliminacin'),(363,'file_manager','control_visibility','Controlar Visibilidad del Ejercicio'),(364,'file_manager','copy_files','Copiar Archivos'),(365,'file_manager','copy_marked','Copiar archivos marcados'),(366,'file_manager','copy_or_delete_files','Copiar o Eliminar Archivos'),(367,'file_manager','create_exercise_button','Crear ejercicio'),(368,'file_manager','create_exercise_heading','Crear ejercicio'),(369,'file_manager','create_folder','Crear Carpeta'),(370,'file_manager','create_folder_button','Crear carpeta'),(371,'file_manager','create_folder_heading','Crear carpeta'),(372,'file_manager','deleted_ownership','Propiedad eliminada para estos ejercicios:'),(373,'file_manag