INSERT INTO `bol_language_pt` VALUES (1,'menu','administration','Administrao'),(2,'menu','classes','Classes'),(3,'menu','display_text','Mostrar Texto'),(4,'menu','enroll_in_class','Inscrever-se em classe'),(5,'menu','exercises','Exerccios'),(6,'menu','font_preferences','Preferncias de Fonte'),(7,'menu','home','Pgina Inicial'),(8,'menu','login','Entrar'),(9,'menu','logout','Sair'),(10,'menu','manage_exercises','Administrar exerccios'),(11,'menu','manage_gloss_links','Gloss links'),(12,'menu','my_data','Minhas Informaes'),(13,'menu','privacy_policy','Poltica de Privacidade'),(14,'menu','profile','Perfil'),(15,'menu','statistics','Estatsticas'),(16,'menu','text_and_exercises','Texto e Exerccios'),(17,'menu','users','Usurios'),(18,'menu','user_access','Acesso de usurio'),(19,'intro_text','intro_center','<h1>O que  o Bible Online Learner?</h1>\n\n      <p>Bible Online Learner (Bible OL) d liver aces so  Bblia Hebraica na database ETCBC4\n       e ao text grego do Novo Testamento da verso de 1904 de Nestle com anotaes gramaticais;\n       ademais, professors podem user os exerccios desenvolvidos para o Bible OL ou criar os seus prprios exerccios.</p>\n\n       <p>Bible OL est inter-conectado ao premiado website de testes em Hebraico e de exibio de texto <a\n       href=\"http://shebanq.ancient-data.org\" target=\"shebanq\">SHEBANQ</a>. A partir de um captulo no website Bible\n       OL, clique no logo do SHEBANQ para ser redirecionado diretamente para o mesmo captulo neste website. Ademais,\n       professores podem usar perguntas criadas no website SHEBANQ para gerar exerccios no Bible OL.</p>\n\n       <p>O cdigo-fonte para o Bible OL est disponvel em <a href=\"https://github.com/EzerIT/BibleOL\"\n       target=\"_blank\">GitHub</a>. Nosso desejo  que outros programadores trabalhem com este cdigo e se juntem a ns para desenvolver\n       caractersticas adicionais.</p>'),(20,'intro_text','intro_right1','<p>Desde 2014, o Bible Online Learner  parte do <a href=\"http://global-learning.org\"\n       target=\"_blank\">Global Learning Initiative</a>. Para mais informaes, por favor faa contato com o Professor\n       Nicolai Winther-Nielsen (nwn [at] dbi . edu) de <a\n       href=\"http://fih.fjellhaug.no\" target=\"_blank\">Fjellhaug International\n       University College Denmark (FIUC-DK)</a>.<br>\n             \n       Bible Online Learner foi desenvolvido por Claus Tndering de <a href=\"http://www.ezer.dk\"\n       target=\"_blank\">Ezer IT Consulting</a>.<br>\n\n       Para seu PhD em Aalborg University, Judith Gottschalk est desenvolvendo <i>Learning Journey,</i>\n       um plugin com estatsticas sobre performance de aprendizado.</p>'),(21,'intro_text','intro_right2','<p>Bible Online Learner  baseado em PLOTLearner, um programa de PC desenvolvido como parte do projeto\n       <a href=\"http://www.eplot.eu\" target=\"_blank\">EuroPLOT</a>, 2010-2013. O\n       presente website  resultado de desenvolvimento posterior feito por Ezer IT Consulting fora do projeto\n       EuroPLOT, e o site  mantido por <a href=\"http://3bmoodle.dk\"\n       target=\"_blank\">3BM Bible Software and Multimedia</a>.</p>'),(22,'intro_text','intro_right3','<p>O website SHEBANQ foi criado por Wido van Peursen e Dirk Roorda.</p>'),(23,'intro_text','intro_right_head','Bible Online Learner por um movimento global de aprendizado gratuito'),(24,'intro_text','welcome','Bem-vindo ao Bible Online Learner'),(25,'intro_text','welcome2','%s, bem-vindo ao Bible Online Learner'),(26,'common','already_logged_in','Voc j est logado'),(27,'common','cancel_button','Cancelar'),(28,'common','cannot_open_file','O arquivo %s no pode ser aberto'),(29,'common','close_button','Fechar'),(30,'common','date_time_format','dMY H:i'),(31,'common','error_colon','Erro:'),(32,'common','facebook_no_valid_reply','Resposta invlida do Facebook'),(33,'common','field_required','(Necessrio)'),(34,'common','google_no_valid_reply','Nenhuma resposta vlida do Google'),(35,'common','illegal_class_id',