rte para uslas em marketing ou propsitos promocionais. Ns\n     no venderemos as suas informaes.</p>\n\n     <h2>Deletando sua conta</h2>\n\n     <p>Voc pode deletar sua conta neste website ao selecionar o item de menu Perfil no\n     menu Minhas Informaes e ento clicar no boto Deletar o Perfil. Isso remover todas as \n     informaes sobre o seu nome e endereo de email deste website.</p>\n\n     <h2>Links para outros websites</h2>\n\n     <p>Nosso website pode conter links para habilit-lo  visitar outros websites de interesse facilmente. Contudo,\n     uma vez que voc utilizar esses links para deixar nosso site, voc deveria notar que ns no temos nenhum controle\n     sobre outros websites. Portanto, ns no podemos ser responsveis pela proteo e privacidade de nenhuma informao\n     que voc fornecer enquanto estiver visitando tais sites. Ademais, estes sites no so governados por esta\n     declarao de privacidade. Voc deve exercer cautela e checar a de clarao de privacidade aplicvel ao\n     website em questo.</p>'),(345,'file_manager','access_denied_to','Acesso negado para \'%s\''),(346,'file_manager','added_ownership','Posse adicionada a estes exerccios:'),(347,'file_manager','already_exists','\'%s\' j existe'),(348,'file_manager','cancel_copy','Cancelar operao de copiar'),(349,'file_manager','cancel_copy_title','Cancelar cpia'),(350,'file_manager','cancel_move','Cancelar operao de mover'),(351,'file_manager','cannot_change_visibility_top','Voc no pode mudar a visibilidade da pasta do topo'),(352,'file_manager','cannot_copy','O arquivo \'%s\' no pode ser copiado'),(353,'file_manager','cannot_create_folder','A pasta \'%s\' no pode ser criada'),(354,'file_manager','cannot_delete_file','O arquivo \'%s\' no pode ser excludo'),(355,'file_manager','cannot_delete_folder','A pasta \'%s\' no pode ser excluda'),(356,'file_manager','cannot_open_folder','A pasta \'%s\' no pode ser aberta'),(357,'file_manager','cannot_rename','\'%s\' no pode ser renomeado para \'%s\''),(358,'file